  /**
   * The run() method performs expansion for tom syntax, variables,...
   */
  public void run() {
    long startChrono = System.currentTimeMillis();
    boolean intermediate = getOptionBooleanValue("intermediate");
    TomTerm typedTerm = null;
    try {
      tomKernelTyper.setSymbolTable(getStreamManager().getSymbolTable());
      TomTerm syntaxExpandedTerm = (TomTerm) tom_make_ChoiceTopDown(tom_make_typeTermApplTomSyntax(this)).visit((TomTerm)getWorkingTerm());
      updateSymbolTable();

      syntaxExpandedTerm = typeType(syntaxExpandedTerm);
      TomTerm variableExpandedTerm = typeVariable( tom.engine.adt.tomtype.types.tomtype.EmptyType.make() , syntaxExpandedTerm);
      /* type each BackQuoteTerm into its compiled form */
      TomTerm backQuoteExpandedTerm = (TomTerm) tom_make_ChoiceTopDown(tom_make_typeBackQuoteAppl(this)).visit(variableExpandedTerm);
      TomTerm stringExpandedTerm = (TomTerm) tom_make_ChoiceTopDown(tom_make_typeString(this)).visit(backQuoteExpandedTerm);
      typedTerm = (TomTerm) tom_make_ChoiceTopDown(tom_make_updateCodomain(this)).visit(stringExpandedTerm);
      setWorkingTerm(typedTerm);
      // verbose
      getLogger().log(Level.INFO, TomMessage.tomExpandingPhase.getMessage(),
          new Integer((int)(System.currentTimeMillis()-startChrono)));
    } catch (Exception e) {
      getLogger().log( Level.SEVERE, TomMessage.exceptionMessage.getMessage(),
          new Object[]{getClass().getName(), getStreamManager().getInputFileName(), e.getMessage()} );
      e.printStackTrace();
      return;
    }
    if(intermediate) {
      Tools.generateOutput(getStreamManager().getOutputFileName()
          + TYPED_SUFFIX, typedTerm);
      Tools.generateOutput(getStreamManager().getOutputFileName()
          + TYPED_TABLE_SUFFIX, symbolTable().toTerm());
    }
  }

  /*
   * updateSymbol is called after a first syntax expansion phase
   * this phase updates the symbolTable according to the typeTable
   * this is performed by recursively traversing each symbol
   * - backquote are typed
   * - each TomTypeAlone is replaced by the corresponding TomType
   * - default IsFsymDecl and MakeDecl are added
   */
  public void updateSymbolTable() {
    SymbolTable symbolTable = getStreamManager().getSymbolTable();
    Iterator<String> it = symbolTable.keySymbolIterator();
    Strategy typeStrategy = tom_make_ChoiceTopDown(tom_make_typeTermApplTomSyntax(this));

    while(it.hasNext()) {
      String tomName = it.next();
      TomSymbol tomSymbol = getSymbolFromName(tomName);
      /*
       * add default IsFsymDecl and MakeDecl, unless it is a builtin type
       */
      if(!getStreamManager().getSymbolTable().isBuiltinType(TomBase.getTomType(TomBase.getSymbolCodomain(tomSymbol)))) {
        tomSymbol = addDefaultIsFsym(tomSymbol);
        tomSymbol = addDefaultMake(tomSymbol);
      }
      try {
        tomSymbol = (TomSymbol) tom_make_ChoiceTopDown(tom_make_typeTermApplTomSyntax(this)).visit(tomSymbol);
        tomSymbol = typeType( tom.engine.adt.tomterm.types.tomterm.TomSymbolToTomTerm.make(tomSymbol) ).getAstSymbol();
        tomSymbol = typeVariable( tom.engine.adt.tomtype.types.tomtype.EmptyType.make() , tom.engine.adt.tomterm.types.tomterm.TomSymbolToTomTerm.make(tomSymbol) ).getAstSymbol();
        tomSymbol = (TomSymbol) tom_make_ChoiceTopDown(tom_make_typeBackQuoteAppl(this)).visit(tomSymbol);
      } catch(tom.library.sl.VisitFailure e) {
        System.out.println("should not be there");
      }
      //System.out.println("symbol = " + tomSymbol);
      getStreamManager().getSymbolTable().putSymbol(tomName,tomSymbol);
    }
  }

